# Import Required Libraries
import tensorflow as tf
from tensorflow import keras
import numpy as np
import matplotlib.pyplot as plt
from tensorflow.keras.datasets import mnist
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Conv2D, MaxPooling2D, Flatten, Dense, Dropout, BatchNormalization
from tensorflow.keras.optimizers import SGD

from tensorflow.keras.datasets import cifar10

# Load dataset
(x_train, y_train), (x_test, y_test) = cifar10.load_data()

# Normalize pixel values (0 to 255 → 0 to 1)
x_train, x_test = x_train / 255.0, x_test / 255.0


print("x_train size: ",x_train.shape)
print("x_test size:",x_test.shape)

"""![image.png](data:image/png;base64,)

#Displaying some Images for CIFAR_10 Dataset.
"""

# Display some images
class_names = ['airplane', 'automobile', 'bird', 'cat', 'deer',
               'dog', 'frog', 'horse', 'ship', 'truck']

plt.figure(figsize=(10, 5))
for i in range(10):
    plt.subplot(2, 5, i + 1)
    plt.imshow(x_train[i].reshape(32, 32, 3))  # Reshape back for visualization
    plt.title(class_names[y_train[i][0]])
    plt.axis('off')
plt.show()

"""#CNN Model with more Layers
#Complex Architecture
#BatchNormalization, Dropout()

1 Input Layer

2 Hidden Layers involved

1 Fully Connected Layer

1 Output Layer
"""

model = Sequential([
    Conv2D(filters=32, kernel_size=(3,3), activation='relu',input_shape=(32,32,3)),
    BatchNormalization(), #normalizing the activations before max_pooling
    MaxPooling2D(pool_size=(2,2)),
    Dropout(0.25),

    Conv2D(filters=64, kernel_size=(3,3), activation='relu'), #hiddenLayer 1
    BatchNormalization(),
    MaxPooling2D(pool_size=(2,2)),
    Dropout(0.25),

    Conv2D(filters=128, kernel_size=(3,3), activation='relu'), #hiddenlayer 2
    BatchNormalization(),
    MaxPooling2D(pool_size=(2,2)),
    Dropout(0.25),

    Flatten(), #conversion from higher dimension to 1D
    Dense(128, activation='relu'), #FullyConnected Layer with 128 neurons

    #Dropping out neurons giving probability with 0.5
    Dropout(0.5),

    #Finally Output Layer with 10 neurons classifying 10 classes of images.
    Dense(10, activation='softmax')

])

#compiling model with using optimizer SGD and learning rate 0.01 and choosing nesterov momentum

optimizer = SGD(learning_rate=0.01, momentum=0.9, nesterov=True)
model.compile(optimizer=optimizer, loss='sparse_categorical_crossentropy', metrics=['accuracy'])

#printing summary
model.summary()

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

#Training CNN Model
"""

history = model.fit(x_train, y_train, epochs=50, batch_size=128, validation_data=(x_test,y_test) )

"""#Model Evaluation on Test DataSet"""

test_loss, test_accuracy = model.evaluate(x_test,y_test, verbose=2)
print(f'test Accuracy:{ test_accuracy:.2f}')

"""#Visualizing Training VS Test Accuracy"""

plt.figure(figsize=(12,5))

plt.plot(history.history['accuracy'],'-o',label='Training Accuracy')
plt.plot(history.history['val_accuracy'],'-o',label='Validation Accuracy')
plt.xlabel('Epochs')
plt.ylabel('Accuracy')
plt.legend()
plt.title('Training VS Validation Accuracy')
plt.show()

"""#Making Predictions"""

predictions = model.predict(x_test)

"""#Visualizing the Predictions Upon X_test"""

# CIFAR-10 class labels
class_labels = [
    "Airplane", "Automobile", "Bird", "Cat", "Deer",
    "Dog", "Frog", "Horse", "Ship", "Truck"
]

def pred_vis(index, model, x_test, y_test):
    """ Visualizes the CIFAR-10 test image and its predicted label with correct scaling. """

    # Get model predictions
    predictions = model.predict(np.expand_dims(x_test[index], axis=0))  # Add batch dimension
    predicted_label = np.argmax(predictions[0])  # Get class with highest probability
    actual_label = y_test[index][0]  # Get actual label

    # Set figure size to adjust zoom
    plt.figure(figsize=(3, 3))  # Adjust figure size for better visualization

    # Plot the image
    plt.imshow(x_test[index])  # Display image in full color (no grayscale)
    plt.axis("off")  # Remove axis for a cleaner look

    # Title with actual and predicted label
    plt.title(f'Predicted: {class_labels[predicted_label]}\nActual: {class_labels[actual_label]}',
              fontsize=12, color='blue' if predicted_label == actual_label else 'red')

    plt.show()

# Example usage
pred_vis(2674, model, x_test, y_test)

